import React from 'react'
import './Timebands.css'
import Timeband from '../Timebands/Timeband';

const makeBands = (bands)=>{
 console.log('bands :', bands);
 

  return (
      <div>
          {bands.map((value, index) => (<Timeband key={`item-${index}`} index={index} value={value}/>))}
      </div>

  );

}

export default function Timebands(props) {
  return (
    <div>
      {makeBands(props.props.timebands)}
    </div>
  )
}
